/** @jsxImportSource @emotion/react */
import { jsx, css } from '@emotion/react'

const chattingFormStyle = css`
    height:500px;
    background-color:gray;
    margin-top:20px;
`;

const ChattingForm = () => {
    return(
        <div css={chattingFormStyle}>ChattingForm Form!</div>
    )
}

export default ChattingForm;
